/**
 * @param {string} s
 * @return {string}
 */
var removeStars = function(s) {
    const arr = [];
    let index = 0;
    while (index < s.length) {
      if (s[index] !== '*') {
        arr.push(s[index]);
      } else {
        arr.pop();
      }
      index++;
    }
    return arr.join('');
};


